Google-ren mugikorretarako produktuak eta zerbitzuak (\"Zerbitzuak\") erabilita, onartzen duzu gorde egingo dituzula 
    a) YouTube Erabilera-baldintzak (%1$s/tos_youtube), YouTube-rekin erlazionatutako zerbitzuak erabiltzen dituzunean; 
    b) Google Maps Zehaztapenak eta baldintzak (%1$s/tos_maps), mapetan, tokian eta kokalekuan oinarritutako zerbitzuak erabiltzen dituzunean; 
    c) Google Books Zerbitzu-baldintzak (%1$s/tos_books), Books-ekin erlazionatutako zerbitzuak erabiltzen dituzunean, 
    eta e) Google Zerbitzu-baldintzak (%1$s/utos) gainontzeko zerbitzu guztiak erabiltzen dituzunean; guztiak ere dagokienean eguneratu ahala.
